import React from 'react'
const AuthorItem = ({user}) => {
return (
    <tr>
        <td>
            {user.first_name}
        </td>
        <td>
            {user.last_name}
        </td>
        <td>
            {user.birthday_year}
        </td>
    </tr>
        )
}
